description:
{'type': '/type/text', 'value': "At thirty-six, Quoyle, a third-rate newspaperman, is wrenched violently out of his workaday life when his two-timing wife meets her just desserts. He retreats with his two daughters to his ancestral home on the starkly beautiful Newfoundland coast, where a rich cast of local characters all play a part in Quoyle's struggle to reclaim his life. As three generations of his family cobble up new lives, Quoyle confronts his private demons — and the unpredictable forces of nature and society — and begins to see the possibility of love without pain or misery.

A vigorous, darkly comic, and at times magical portrait of the contemporary American family, The Shipping News shows why Annie Proulx is recognized as one of the most gifted and original writers in America today.

--back cover"}

{'type': '/type/text', 'value': 'Welcome to the world of terror! Let the one and only Stephen King take you into a wold where a macabre mist traps humanity in its swirling horror…where a beautiful young girl offers satanic seduction…where a child’s toy becomes the ultimate instrument of evil…where a man is given a devilish machine that grans him godlike powers…where nothing is what it seems and nowhere is safe…

Stephen King takes you into this world—and the skill that makes him the most spellbinding storyteller of our time will not let you escape before the final fearful turn of the page.
—back cover'}

{'type': '/type/text', 'value': 'The Bluest Eye, published in 1970, is the first novel written by Toni Morrison, winner of the 1993 Nobel Prize in Literature.

It is the story of eleven-year-old Pecola Breedlove--a black girl in an America whose love for its blond, blue-eyed children can devastate all others--who prays for her eyes to turn blue: so that she will be beautiful, so that people will look at her, so that her world will be different. This is the story of the nightmare at the heart of her yearning and the tragedy of its fulfillment. 
(front flap)'}

{'type': '/type/text', 'value': 'THE GREATEST FANTASY EPIC OF OUR TIME

The dark, fearsome Ringwraiths are searching for a Hobbit. Frodo Baggins knows that they are seeking him and the Ring he bears—the Ring of Power that will enable evil Sauron to destroy all that is good in Middle-earth. Now it is up to Frodo and his faithful servant, Sam, with a small band of companions, to carry the Ring to the one place it can be destroyed: Mount Doom, in the very center of Sauron’s realm.

--back cover'}

{'type': '/type/text', 'value': 'When it first appeared, one volume per month, Stephen King's THE GREEN MILE was an unprecedented publishing triumph: all six volumes ended up on the New York Times bestseller lists—simultaneously—and delighted millions of fans the world over.

Welcome to Cold Mountain Penitentiary, home to the Depression-worn men of E Block. Convicted killers all, each awaits his turn to walk the Green Mile, keeping a date with "Old Sparky," Cold Mountain's electric chair. Prison guard Paul Edgecombe has seen his share of oddities in his years working the Mile. But he's never seen anyone like John Coffey, a man with the body of a giant and the mind of a child, condemned for a crime terrifying in its violence and shocking in its depravity. In this place of ultimate retribution, Edgecombe is about to discover the terrible, wondrous truth about Coffey, a truth that will challenge his most cherished beliefes... and yours.
--back cover'}

