description:
{'type': '/type/text', 'value': 'It is now six years since the secret disaster at Jurassic Park, six years since the extraordinary dream of science and imagination came to a crashing end--the dinosaurs destroyed, the park dismantled, the island definitely closed to the public.

There are rumors that something has survived...
--back cover'}

